def fib(x):
	if(x == 1):
		return "0"
	elif(x == 2):
		return "0 1"
	elif(x == 3):
		return "0 1 1"
	else:
		tmp = fib(x-1).split()
		return fib(x-1)+" "+str(int(tmp[-1])+int(tmp[-2]))


